import sys
class Solution:
    def flood(self, board, i, j):
        board[i][j] = "*"
        if i > 0 and board[i - 1][j] == "O":
            self.flood(board, i - 1, j)
        if i < len(board) - 1 and board[i + 1][j] == "O":
            self.flood(board, i + 1, j)
        if j > 0 and board[i][j - 1] == "O":
            self.flood(board, i, j - 1)
        if j < len(board[0]) - 1 and board[i][j + 1] == "O":
            self.flood(board, i, j + 1)
    def solve(self, board):
        sys.setrecursionlimit(1500)
        b = [list(row) for row in board]
        m = len(b)
        if m == 0:
            return

        n = len(b[0])
        if n == 0:
            return
        for i in range(n):
            if b[0][i] == "O":
                self.flood(b, 0, i)
            if b[m - 1][i] == "O":
                self.flood(b, m - 1, i)
        for i in range(m):
            if b[i][0] == "O":
                self.flood(b, i, 0)
            if b[i][n - 1] == "O":
                self.flood(b, i, n - 1)
        for i in range(m):
            for j in range(n):
                if b[i][j] == "O":
                    b[i][j] = "X"
                elif b[i][j] == "*":
                    b[i][j] = "O"
        for i in range(len(board)):
            board[i] = "".join(b[i])

